(1, 'english-01', '[{\"answer\": \"B\", \"options\": [\"Goodbye\", \"A greeting\", \"A question\", \"A warning\"], \"question\": \"What does \'hello\' mean?\"}, {\"answer\": \"C\", \"options\": [\"In the morning\", \"At lunchtime\", \"In the evening before sleeping\", \"During a meeting\"], \"question\": \"When do you say \'good night\'?\"}, {\"answer\": \"C\", \"options\": [\"Go away\", \"I\'m late\", \"Please let me pass or I\'m sorry\", \"Be quiet\"], \"question\": \"What does \'excuse me\' mean?\"}, {\"answer\": \"A\", \"options\": [\"No\", \"Maybe\", \"Sure\", \"Always\"], \"question\": \"What is the opposite of \'yes\'?\"}, {\"answer\": \"C\", \"options\": [\"Thank you\", \"Excuse me\", \"I\'m sorry\", \"How are you?\"], \"question\": \"What do you say when you make a mistake?\"}, {\"answer\": \"B\", \"options\": [\"Goodbye\", \"Hello for the first time\", \"Good job\", \"See you later\"], \"question\": \"What does \'nice to meet you\' mean?\"}, {\"answer\": \"C\", \"options\": [\"No\", \"I\'m sorry\", \"Thank you\", \"Go away\"], \"question\": \"What do you say when someone gives you a gift?\"}, {\"answer\": \"C\", \"options\": [\"Not nice\", \"Bad\", \"Positive or nice\", \"Ugly\"], \"question\": \"What does \'good\' mean?\"}, {\"answer\": \"B\", \"options\": [\"Beautiful\", \"Not pretty\", \"Kind\", \"Tall\"], \"question\": \"What does \'ugly\' mean?\"}, {\"answer\": \"B\", \"options\": [\"Hard\", \"Simple or not difficult\", \"Expensive\", \"Ugly\"], \"question\": \"What does \'easy\' mean?\"}, {\"answer\": \"C\", \"options\": [\"Yesterday\", \"Today\", \"The next day\", \"Last week\"], \"question\": \"What does \'tomorrow\' mean?\"}, {\"answer\": \"B\", \"options\": [\"The weekend\", \"The first day of the work week\", \"A holiday\", \"The last day of the month\"], \"question\": \"What is \'Monday\'?\"}, {\"answer\": \"C\", \"options\": [\"Tiny\", \"Short\", \"Big\", \"Little\"], \"question\": \"What is the opposite of \'small\'?\"}, {\"answer\": \"B\", \"options\": [\"Far away\", \"Close to\", \"Above\", \"Behind\"], \"question\": \"What does \'near\' mean?\"}, {\"answer\": \"C\", \"options\": [\"To rest\", \"To eat\", \"To perform an action\", \"To stop\"], \"question\": \"What does \'do\' mean?\"}, {\"answer\": \"C\", \"options\": [\"Cooking\", \"Reading\", \"Knowing dates\", \"Walking\"], \"question\": \"What does \'calendar\' help you with?\"}, {\"answer\": \"C\", \"options\": [\"60 seconds\", \"24 hours\", \"60 minutes\", \"A calendar\"], \"question\": \"What does \'hour\' refer to?\"}, {\"answer\": \"C\", \"options\": [\"I\'m hungry\", \"I want more\", \"I appreciate it\", \"Let\'s go\"], \"question\": \"What does \'thank you\' mean?\"}, {\"answer\": \"C\", \"options\": [\"Warm\", \"Wet\", \"Hot\", \"Cool\"], \"question\": \"What is the opposite of \'cold\'?\"}, {\"answer\": \"B\", \"options\": [\"Hello\", \"Goodbye\", \"Sorry\", \"Please\"], \"question\": \"What do you say when leaving?\"}]'),
(4, 'english-02', '[{\"answer\": \"B\", \"options\": [\"A small child who is not yet grown up\", \"A person who is of legal age and fully developed\", \"An infant in their first months of life\", \"A teenager going through high school years\"], \"question\": \"What does \'adult\' mean?\"}, {\"answer\": \"B\", \"options\": [\"It tells a story about a fictional event\", \"It is a public notice that advertises something to people\", \"It is a private letter meant for one person only\", \"It is a piece of music used in performances\"], \"question\": \"What does an \'advertisement\' do?\"}, {\"answer\": \"B\", \"options\": [\"To leave a place and go far away\", \"To come to the place you planned to go or reach\", \"To walk around aimlessly without direction\", \"To forget something important completely\"], \"question\": \"What does \'arrive\' mean?\"}, {\"answer\": \"C\", \"options\": [\"Buy it with your own money for long-term use\", \"Give it away freely without expecting it back\", \"Use it and then give it back after some time\", \"Lose it while you are using it for something\"], \"question\": \"When you \'borrow\' something, what do you do?\"}, {\"answer\": \"B\", \"options\": [\"Hide from people during a special moment\", \"Do something special to show you are happy about something great\", \"Work quietly and not speak to others at all\", \"Argue with your friends loudly in public\"], \"question\": \"\'Celebrate\' means to...\"}, {\"answer\": \"B\", \"options\": [\"A person who sells things in a store or market\", \"A person who pays money for goods or services at a shop\", \"A manager who oversees a large business or store\", \"An inventor who creates new products or tools\"], \"question\": \"Who is a \'customer\'?\"}, {\"answer\": \"B\", \"options\": [\"Is safe and can be used by everyone at home\", \"Causes danger and could hurt you badly or seriously\", \"Is cheap and easy to buy from local stores\", \"Is comfortable to use and easy to understand\"], \"question\": \"If something is \'dangerous\', it...\"}, {\"answer\": \"B\", \"options\": [\"Do nothing and wait for someone else to help\", \"Choose one option among several choices carefully\", \"Wait for someone else to make the final choice\", \"Sleep on it without thinking too hard about it\"], \"question\": \"When you \'decide\', you...\"}, {\"answer\": \"C\", \"options\": [\"Tastes bad and is hard to eat for most people\", \"Is rotten and should not be eaten by anyone\", \"Is tasty or tastes very nice to eat and enjoy\", \"Is simple to cook using common kitchen tools\"], \"question\": \"If food is \'delicious\', it...\"}, {\"answer\": \"B\", \"options\": [\"The quality of being the same in every way\", \"The quality of being different or a characteristic that makes something not the same\", \"A type of food that is usually served hot\", \"A place to live with your family and pets\"], \"question\": \"What is a \'difference\'?\"}, {\"answer\": \"B\", \"options\": [\"A type of book\", \"The natural world around us and the area where you live or work\", \"A computer program\", \"A building\"], \"question\": \"What is the \'environment\'?\"}, {\"answer\": \"B\", \"options\": [\"Nobody knows about them\", \"Many people know about them\", \"They are shy\", \"They are fast\"], \"question\": \"When someone or something is \'famous\', what does it mean?\"}, {\"answer\": \"B\", \"options\": [\"A boring meeting\", \"An organized event with performances or a celebration that happens for a special occasion\", \"A type of school\", \"A piece of furniture\"], \"question\": \"What is a \'festival\'?\"}, {\"answer\": \"B\", \"options\": [\"Serious and sad\", \"Interesting and makes people laugh, or unusual\", \"Dangerous\", \"Heavy\"], \"question\": \"If something is \'funny\', it is...\"}, {\"answer\": \"C\", \"options\": [\"The future\", \"Stories about imaginary places\", \"What happened in the past and the study of past events\", \"A science experiment\"], \"question\": \"What does \'history\' refer to?\"}, {\"answer\": \"B\", \"options\": [\"Unnecessary\", \"Main or primary\", \"Old-fashioned\", \"Very small\"], \"question\": \"When something is \'important\', it is...\"}, {\"answer\": \"B\", \"options\": [\"Ignore them\", \"Ask them to be somewhere or to do something\", \"Give them money\", \"Argue with them\"], \"question\": \"To \'invite\' someone means to...\"}, {\"answer\": \"B\", \"options\": [\"Have no chance\", \"Have a lot of luck or something that gives you luck\", \"Are always sad\", \"Are always angry\"], \"question\": \"If you are \'lucky\', you...\"}, {\"answer\": \"B\", \"options\": [\"A piece of furniture\", \"Information sent from one person to another\", \"A journey\", \"A flower\"], \"question\": \"A \'message\' is...\"}, {\"answer\": \"B\", \"options\": [\"Mixed up\", \"Where they should be or in a particular sequence\", \"Broken\", \"Lost\"], \"question\": \"When things are in \'order\', they are...\"}, {\"answer\": \"B\", \"options\": [\"Is disliked by many people\", \"Is liked or enjoyed by many people\", \"Is expensive\", \"Is very small\"], \"question\": \"If something is \'popular\', it...\"}, {\"answer\": \"B\", \"options\": [\"Break it\", \"Fix it so it is not broken\", \"Throw it away\", \"Hide it\"], \"question\": \"To \'repair\' something means to...\"}, {\"answer\": \"B\", \"options\": [\"The driver of a vehicle\", \"A person who travels in a vehicle but does not drive or work on it\", \"A policeman\", \"A ticket\"], \"question\": \"A \'passenger\' is...\"}, {\"answer\": \"B\", \"options\": [\"Read a book\", \"Say an option or recommend\", \"Laugh loudly\", \"Dance\"], \"question\": \"If someone \'suggests\' something, they...\"}, {\"answer\": \"B\", \"options\": [\"Stay in one place\", \"Go from one place to another\", \"Build a house\", \"Watch TV\"], \"question\": \"To \'travel\' is to...\"}, {\"answer\": \"B\", \"options\": [\"Very easy\", \"Not easy\", \"Very small\", \"Cheap\"], \"question\": \"If something is \'difficult\', it is...\"}, {\"answer\": \"B\", \"options\": [\"Have lots of energy\", \"Need a rest because you have no energy\", \"Are extremely hungry\", \"Are excited\"], \"question\": \"If you feel \'tired\', you...\"}, {\"answer\": \"B\", \"options\": [\"Throw it away\", \"Give or put it back\", \"Keep it forever\", \"Burn it\"], \"question\": \"When you \'return\' something, you...\"}, {\"answer\": \"B\", \"options\": [\"Work very hard\", \"Stop working or worrying and rest or have fun\", \"Move to another city\", \"Study\"], \"question\": \"When you \'relax\', you...\"}, {\"answer\": \"B\", \"options\": [\"Send something\", \"Get something that was given or sent to you\", \"Hide something\", \"Ignore it\"], \"question\": \"If you \'receive\' something, you...\"}]'),
(5, 'english-03', '[{\"answer\": \"B\", \"options\": [\"The smallest number in a set\", \"A number or measure that is in the middle of several numbers\", \"A random guess\", \"The total sum of numbers\"], \"question\": \"What does \'average\' mean?\"}, {\"answer\": \"B\", \"options\": [\"How much money you owe\", \"How much money you have in your bank account\", \"The total cost of groceries\", \"The difference between two prices\"], \"question\": \"What is \'balance\' when talking about money?\"}, {\"answer\": \"B\", \"options\": [\"A type of weather\", \"A natural event that causes the ground to shake and may destroy buildings\", \"A sudden noise\", \"A big rainstorm\"], \"question\": \"What is an \'earthquake\'?\"}, {\"answer\": \"B\", \"options\": [\"A type of machine\", \"The use of resources of a community or system\", \"A large building\", \"A holiday\"], \"question\": \"What is an \'economy\'?\"}, {\"answer\": \"B\", \"options\": [\"Ignore them\", \"Make them feel they want to do something or can do it\", \"Make them feel sad\", \"Stop them from acting\"], \"question\": \"If you \'encourage\' someone, you...\"}, {\"answer\": \"B\", \"options\": [\"Stay where you are\", \"Get away from something\", \"Sleep deeply\", \"Laugh loudly\"], \"question\": \"To \'escape\' means to...\"}, {\"answer\": \"B\", \"options\": [\"An object\", \"An event that happens to you\", \"A type of car\", \"A part of a book\"], \"question\": \"What is an \'experience\'?\"}, {\"answer\": \"A\", \"options\": [\"A decision decided by voting\", \"A game\", \"A kind of festival\", \"A dance\"], \"question\": \"What is an \'election\'?\"}, {\"answer\": \"B\", \"options\": [\"A casual meeting\", \"A serious situation that needs to be dealt with quickly\", \"A small party\", \"A regular routine\"], \"question\": \"What is an \'emergency\'?\"}, {\"answer\": \"B\", \"options\": [\"A physical object\", \"A human feeling, such as sadness or anger\", \"A metal tool\", \"A mathematical symbol\"], \"question\": \"What is an \'emotion\'?\"}, {\"answer\": \"B\", \"options\": [\"A person who likes you\", \"A person who is against you or does not like you\", \"A friendly pet\", \"A person you support\"], \"question\": \"Who is an \'enemy\'?\"}, {\"answer\": \"B\", \"options\": [\"Someone who sells clothes\", \"Someone paid to solve technical problems or invent things\", \"A person who drives trains\", \"Someone who cooks food\"], \"question\": \"Who is an \'engineer\'?\"}, {\"answer\": \"B\", \"options\": [\"Useless\", \"Very important or impossible to succeed without\", \"Optional\", \"Old-fashioned\"], \"question\": \"If something is \'essential\', it is...\"}, {\"answer\": \"B\", \"options\": [\"Immediately\", \"In the future, not soon\", \"Never\", \"Every day\"], \"question\": \"If something will happen \'eventually\', it will happen...\"}, {\"answer\": \"B\", \"options\": [\"Ignore it\", \"Look at it carefully\", \"Destroy it\", \"Talk about it\"], \"question\": \"To \'examine\' something means to...\"}, {\"answer\": \"B\", \"options\": [\"Shrinks\", \"Becomes bigger\", \"Changes color\", \"Disappears\"], \"question\": \"If something \'expands\', it...\"}, {\"answer\": \"A\", \"options\": [\"A thing sent to another country for business\", \"A local sale\", \"A tourist attraction\", \"A type of food\"], \"question\": \"What is an \'export\'?\"}, {\"answer\": \"A\", \"options\": [\"Make them feel afraid\", \"Make them feel happy\", \"Invite them to dinner\", \"Ignore them\"], \"question\": \"To \'frighten\' someone means to...\"}, {\"answer\": \"B\", \"options\": [\"Does not exist\", \"Exists and you can use it\", \"Is broken\", \"Is hidden\"], \"question\": \"If something is \'available\', it...\"}, {\"answer\": \"B\", \"options\": [\"Complex and difficult\", \"Simple\", \"Expensive\", \"Secret\"], \"question\": \"When something is \'basic\', it is...\"}, {\"answer\": \"B\", \"options\": [\"A problem\", \"Something good that comes from something else\", \"A waste of time\", \"A type of food\"], \"question\": \"A \'benefit\' is...\"}, {\"answer\": \"A\", \"options\": [\"Do not let fear stop you\", \"Always run away\", \"Talk very quietly\", \"Never think\"], \"question\": \"To be \'brave\' means you...\"}, {\"answer\": \"A\", \"options\": [\"Something difficult that you want or have to do\", \"A simple task\", \"A type of weather\", \"A holiday\"], \"question\": \"A \'challenge\' is...\"}, {\"answer\": \"B\", \"options\": [\"A certain fact\", \"Something that can happen, or how likely something is\", \"A promise\", \"A sure plan\"], \"question\": \"A \'chance\' is...\"}, {\"answer\": \"B\", \"options\": [\"The mood of a person\", \"The weather conditions of a place\", \"A government system\", \"A type of fabric\"], \"question\": \"What is \'climate\'?\"}, {\"answer\": \"A\", \"options\": [\"A group of people living in the same area with similar background or interests\", \"A single person\", \"A piece of art\", \"A type of building\"], \"question\": \"What is a \'community\'?\"}, {\"answer\": \"B\", \"options\": [\"Ignore them\", \"Look at how they are the same and different\", \"Sell them\", \"Throw them away\"], \"question\": \"To \'compare\' two things means to...\"}, {\"answer\": \"B\", \"options\": [\"Divide your attention\", \"Use most of your time and thoughts on it\", \"Forget about it\", \"Laugh about it\"], \"question\": \"To \'concentrate\' on something means to...\"}, {\"answer\": \"B\", \"options\": [\"A type of plant\", \"A common history, set of beliefs, or way of life within a group\", \"A computer program\", \"A large building\"], \"question\": \"A \'culture\' is...\"}, {\"answer\": \"A\", \"options\": [\"Is broken or hurt\", \"Is brand new\", \"Is improved\", \"Is cheap\"], \"question\": \"If something has \'damage\', it...\"}, {\"answer\": \"A\", \"options\": [\"A sudden thought with purpose about what you will do\", \"A random action\", \"A letter\", \"A place\"], \"question\": \"A \'decision\' is...\"}, {\"answer\": \"B\", \"options\": [\"Not care about it\", \"Need it or rely on it\", \"Destroy it\", \"Hide it\"], \"question\": \"To \'depend\' on something means to...\"}, {\"answer\": \"B\", \"options\": [\"A type of food\", \"A way to move or point; directions are steps telling you what to do\", \"A type of animal\", \"A color\"], \"question\": \"A \'direction\' is...\"}, {\"answer\": \"B\", \"options\": [\"Shout loudly\", \"Talk about something\", \"Run away\", \"Sing a song\"], \"question\": \"To \'discuss\' means to...\"}, {\"answer\": \"B\", \"options\": [\"Does not work\", \"Works well as planned\", \"Is temporary\", \"Makes things worse\"], \"question\": \"If something is \'effective\', it...\"}, {\"answer\": \"A\", \"options\": [\"The amount of work done on something\", \"The cost of something\", \"A type of plan\", \"A piece of art\"], \"question\": \"What is \'effort\'?\"}, {\"answer\": \"B\", \"options\": [\"Different in size\", \"The same in shape, size, or number\", \"Broken\", \"Opposite colors\"], \"question\": \"If two things are \'equal\', they are...\"}, {\"answer\": \"B\", \"options\": [\"Sports and games\", \"Money or business\", \"Music and art\", \"Cooking and food\"], \"question\": \"If something is \'financial\', it is about...\"}, {\"answer\": \"B\", \"options\": [\"Never bend or change\", \"Bend or change easily\", \"Explode\", \"Melt\"], \"question\": \"If someone or something is \'flexible\', it can...\"}, {\"answer\": \"B\", \"options\": [\"A vacation\", \"The purpose or job of something\", \"A random idea\", \"A piece of art\"], \"question\": \"A \'function\' is...\"}, {\"answer\": \"B\", \"options\": [\"Destroy it\", \"Create it\", \"Ignore it\", \"Hide it\"], \"question\": \"To \'generate\' something means to...\"}, {\"answer\": \"B\", \"options\": [\"Affects only one person\", \"Includes the whole world\", \"Is very small\", \"Is hidden\"], \"question\": \"If something is \'global\', it...\"}, {\"answer\": \"B\", \"options\": [\"A type of animal\", \"The effect of an act, statement, or change\", \"A small tool\", \"A game\"], \"question\": \"An \'impact\' is...\"}, {\"answer\": \"B\", \"options\": [\"Leave it out\", \"Make it part of something else\", \"Destroy it\", \"Throw it away\"], \"question\": \"To \'include\' something means to...\"}, {\"answer\": \"B\", \"options\": [\"Become smaller\", \"Grow or become bigger\", \"Stay the same\", \"Stop entirely\"], \"question\": \"To \'increase\' means to...\"}, {\"answer\": \"B\", \"options\": [\"A group of people\", \"A person or thing looked at separately from others\", \"A city\", \"A tool\"], \"question\": \"An \'individual\' is...\"}, {\"answer\": \"B\", \"options\": [\"Break it\", \"Keep it safe and stop harm\", \"Ignore it\", \"Paint it\"], \"question\": \"To \'protect\' something means to...\"}, {\"answer\": \"B\", \"options\": [\"A type of plant\", \"An area of land or of the body\", \"A moment in time\", \"A kind of music\"], \"question\": \"A \'region\' is...\"}, {\"answer\": \"B\", \"options\": [\"The study of animals\", \"Tools, equipment and activities that come from scientific knowledge\", \"A type of art\", \"A city\"], \"question\": \"What is \'technology\'?\"}, {\"answer\": \"B\", \"options\": [\"Unimportant\", \"Important or large enough to notice\", \"Tiny and invisible\", \"Cheap and easy\"], \"question\": \"If something is \'significant\', it is...\"}]'),
(8, 'comp705-01', '[\n    {\n        \"question\": \"What is software engineering?\",\n        \"options\": [\n            \"The process of designing, developing, testing, and maintaining software\",\n            \"Writing code only\",\n            \"Hardware development\",\n            \"Data entry\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Software engineering is a systematic, disciplined, and ___ approach.\",\n        \"options\": [\n            \"Creative\",\n            \"Quantifiable\",\n            \"Spontaneous\",\n            \"Ad-hoc\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which phase is NOT listed as part of the techniques and methodologies in software engineering?\",\n        \"options\": [\n            \"Requirements analysis\",\n            \"Testing\",\n            \"Maintenance\",\n            \"Marketing\"\n        ],\n        \"answer\": \"D\"\n    },\n    {\n        \"question\": \"Software engineering is mainly used for projects based on ___.\",\n        \"options\": [\n            \"Browser plugins\",\n            \"Software systems\",\n            \"Graphic design\",\n            \"Spreadsheet macros\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"One of the key goals of software engineering is to deliver software that is ___.\",\n        \"options\": [\n            \"Costly and complicated\",\n            \"Quick but unreliable\",\n            \"On time, on budget, and meets needs\",\n            \"Basic with limited use\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"What is not a main attribute of software engineering?\",\n        \"options\": [\n            \"High upfront costs\",\n            \"Limited flexibility\",\n            \"Rapid prototyping\",\n            \"Disciplined approach\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"Implementing software engineering may require significant investment in ___.\",\n        \"options\": [\n            \"Marketing campaigns\",\n            \"Tools and training\",\n            \"Office location\",\n            \"Customer events\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Following established principles can sometimes limit ___.\",\n        \"options\": [\n            \"Productivity\",\n            \"Flexibility\",\n            \"Accuracy\",\n            \"Budget\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which of the following is not one of the four main attributes of software engineering?\",\n        \"options\": [\n            \"Systematic\",\n            \"Disciplined\",\n            \"Quantifiable\",\n            \"Ad-lib\"\n        ],\n        \"answer\": \"D\"\n    },\n    {\n        \"question\": \"Software is described as a ___ or set of programs.\",\n        \"options\": [\n            \"Computer\",\n            \"Spreadsheet\",\n            \"Program\",\n            \"Network\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"Engineering is the process of designing and building something that serves a particular purpose and finds a ___ solution.\",\n        \"options\": [\n            \"Difficult\",\n            \"Cost-effective\",\n            \"Overcomplicated\",\n            \"Temporary\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"The introduction states that software engineering is both ___ and disciplined.\",\n        \"options\": [\n            \"Creative\",\n            \"Systematic\",\n            \"Spontaneous\",\n            \"Random\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which methodology stage is not explicitly cited in that article\'s introduction?\",\n        \"options\": [\n            \"Analysis\",\n            \"Design\",\n            \"Marketing\",\n            \"Maintenance\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"What ensures that software is consistent, correct, and released on time?\",\n        \"options\": [\n            \"Software engineering\",\n            \"DIY scripting\",\n            \"Trial and error\",\n            \"Last-minute coding\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"New tools and technologies are constantly being ___ to improve the software development process.\",\n        \"options\": [\n            \"Ignored\",\n            \"Discarded\",\n            \"Developed\",\n            \"Overlooked\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"Which of these is a disadvantage of software engineering mentioned?\",\n        \"options\": [\n            \"High upfront costs\",\n            \"Too much creativity\",\n            \"Lack of documentation\",\n            \"No benefits\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"The article suggests software engineering aims to create software that is high-quality, reliable, and ___.\",\n        \"options\": [\n            \"Complicated\",\n            \"Maintainable\",\n            \"Inconsistent\",\n            \"Opaque\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"The introduction is part of the ___ section in the GeeksforGeeks tutorial.\",\n        \"options\": [\n            \"Advanced\",\n            \"Introduction to Software Engineering\",\n            \"Interview questions\",\n            \"Guest articles\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"According to the intro, software engineering uses a ___ approach.\",\n        \"options\": [\n            \"Haphazard\",\n            \"Random\",\n            \"Systematic and disciplined\",\n            \"Marketing-driven\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"Software engineering is especially suitable for ___ projects.\",\n        \"options\": [\n            \"Toy scripts\",\n            \"Single-use macros\",\n            \"Large software systems\",\n            \"One-line utilities\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"What does SDLC stand for?\",\n        \"options\": [\n            \"Software Design Logical Cycle\",\n            \"System Development Lifecycle\",\n            \"Software Development Life Cycle\",\n            \"Structured Development Life Cycle\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"What is the primary goal of SDLC?\",\n        \"options\": [\n            \"Deliver high-quality, maintainable software that meets user requirements\",\n            \"Reduce software size\",\n            \"Minimize testing\",\n            \"Avoid documentation\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Which stage comes first in the SDLC?\",\n        \"options\": [\n            \"Design\",\n            \"Planning and Requirement Analysis\",\n            \"Testing\",\n            \"Deployment\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which of the following is NOT a stage of SDLC as per the article?\",\n        \"options\": [\n            \"Planning and Requirement Analysis\",\n            \"Design\",\n            \"Development\",\n            \"Retirement\"\n        ],\n        \"answer\": \"D\"\n    },\n    {\n        \"question\": \"SDLC is described as a methodology that defines the procedure of software development ____.\",\n        \"options\": [\n            \"step-by-step\",\n            \"ad-hoc\",\n            \"improvisational\",\n            \"unsystematic\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"SDLC specifies tasks to be performed at various stages by ____.\",\n        \"options\": [\n            \"project managers only\",\n            \"a marketing team\",\n            \"software engineers or developers\",\n            \"end users\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"One key benefit of SDLC is that it ensures the end product meets the customer\'s ____.\",\n        \"options\": [\n            \"expectations and fits within the budget\",\n            \"design preferences\",\n            \"development team\'s convenience\",\n            \"latest UI trends\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"SDLC provides a precise plan describing how to develop, maintain, replace, and ____ software.\",\n        \"options\": [\n            \"license\",\n            \"discontinue\",\n            \"enhance\",\n            \"market\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"What is emphasized at every stage of SDLC according to the conceptual model?\",\n        \"options\": [\n            \"Risk management\",\n            \"Marketing strategy\",\n            \"Customer incentives\",\n            \"Sales forecasting\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Which SDLC methodology emphasizes sequential stages like planning, design, testing, deployment, and maintenance?\",\n        \"options\": [\n            \"Agile\",\n            \"Waterfall\",\n            \"Kanban\",\n            \"Lean\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which SDLC models are listed as top models in one of the related articles?\",\n        \"options\": [\n            \"DevOps, Lean, XP, Spiral, Agile\",\n            \"Agile, Waterfall, Spiral, Iterative, V-Shaped\",\n            \"Scrum, XP, Lean, Kanban, RAD\",\n            \"Waterfall, XP, Spiral, DevOps, Crystal\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which model combines iterative development with risk management?\",\n        \"options\": [\n            \"Waterfall\",\n            \"V-Model\",\n            \"Spiral\",\n            \"Prototyping\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"SDLC is a model followed by many ____ organizations to develop software.\",\n        \"options\": [\n            \"marketing\",\n            \"software development\",\n            \"financial\",\n            \"logistics\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"According to AWS, SDLC helps minimize project ____ through forward planning.\",\n        \"options\": [\n            \"size\",\n            \"risks\",\n            \"users\",\n            \"documentation\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which of the following is a framework used to structure software development life cycle?\",\n        \"options\": [\n            \"SDLC\",\n            \"HTML\",\n            \"HTTP\",\n            \"JSON\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Which SDLC stage focuses on gathering customer inputs and conducting market surveys?\",\n        \"options\": [\n            \"Requirement Analysis\",\n            \"Design\",\n            \"Deployment\",\n            \"Testing\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Which phase of the Software Development Life Cycle (SDLC) focuses on defining detailed functional and non-functional requirements?\",\n        \"options\": [\n            \"Planning\",\n            \"Requirements Analysis\",\n            \"Implementation\",\n            \"Testing\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"SDLC divides the software design process into ____ parts.\",\n        \"options\": [\n            \"few\",\n            \"small\",\n            \"unrelated\",\n            \"excessive\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"SDLC ensures delivery of ____ software as per the article.\",\n        \"options\": [\n            \"inefficient\",\n            \"high-quality, maintainable\",\n            \"expensive\",\n            \"temporary\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"The SDLC provides a structured process to design, develop, and ____ software.\",\n        \"options\": [\n            \"distribute\",\n            \"test\",\n            \"sell\",\n            \"archive\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which of the following is **not** explicitly mentioned as a key factor of software quality in the article?\",\n        \"options\": [\n            \"Portability\",\n            \"Usability\",\n            \"Correctness\",\n            \"Scalability\"\n        ],\n        \"answer\": \"D\"\n    },\n    {\n        \"question\": \"Software quality ensures a product is reliable, maintainable, and ___.\",\n        \"options\": [\n            \"User-friendly\",\n            \"Expensive\",\n            \"Complex\",\n            \"Outdated\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Software quality goes beyond just meeting ___.\",\n        \"options\": [\n            \"Deadlines\",\n            \"Requirements\",\n            \"Budgets\",\n            \"User feedback\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which of these is **not** listed in the article\'s conclusion?\",\n        \"options\": [\n            \"Efficiency\",\n            \"Correctness\",\n            \"Portability\",\n            \"Marketability\"\n        ],\n        \"answer\": \"D\"\n    },\n    {\n        \"question\": \"A robust quality management system and continuous improvement processes help achieve ___ standards.\",\n        \"options\": [\n            \"Financial\",\n            \"Operational\",\n            \"Quality\",\n            \"Marketing\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"High-quality software is described as functional, efficient, and ___.\",\n        \"options\": [\n            \"Adaptable to user needs\",\n            \"Expensive\",\n            \"Proprietary\",\n            \"Obsolete\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Software quality involves key factors like portability, usability, correctness, and ___.\",\n        \"options\": [\n            \"Efficiency\",\n            \"Security\",\n            \"Popularity\",\n            \"Cost\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Which characteristic of good software includes functionality, usability, reliability, performance, and security?\",\n        \"options\": [\n            \"Software Quality\",\n            \"Software Characteristics\",\n            \"Software Requirements\",\n            \"Software Documentation\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"According to GeeksforGeeks, good software meets user needs, performs reliably, and is ___.\",\n        \"options\": [\n            \"Easy to maintain\",\n            \"Hard to reproduce\",\n            \"Expensive to run\",\n            \"Technically deep\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Which of the following is **not** typically included in characteristics of good software?\",\n        \"options\": [\n            \"Testability\",\n            \"Scalability\",\n            \"Maintainability\",\n            \"Randomness\"\n        ],\n        \"answer\": \"D\"\n    },\n    {\n        \"question\": \"What does Quality Assurance (QA) focus on according to GeeksforGeeks?\",\n        \"options\": [\n            \"Preventing defects by ensuring proper processes are followed\",\n            \"Fixing defects after development ends\",\n            \"Marketing software quality\",\n            \"Ignoring development standards\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Quality Control (QC) is primarily concerned with ___.\",\n        \"options\": [\n            \"Implementing development standards\",\n            \"Identifying and fixing defects after development\",\n            \"Defining quality policies\",\n            \"Preventing process errors\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which activity runs parallel to Software Development and ensures processes are implemented correctly?\",\n        \"options\": [\n            \"Software Marketing\",\n            \"Software Quality Assurance (SQA)\",\n            \"Database Management\",\n            \"User Experience Design\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"SQA is described as an umbrella activity that is applied ___ the software process.\",\n        \"options\": [\n            \"At the end of\",\n            \"Parallel to\",\n            \"Before\",\n            \"After deployment of\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Quality planning involves identifying and incorporating relevant quality ___.\",\n        \"options\": [\n            \"Standards into product and processes\",\n            \"Cost estimates\",\n            \"Marketing strategies\",\n            \"User training\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"What is the main goal of a Software Quality Assurance Plan?\",\n        \"options\": [\n            \"Guarantee the product is trouble- and bug-free\",\n            \"Improve UI design aesthetics\",\n            \"Reduce software licensing costs\",\n            \"Optimize network traffic\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"A Software Quality Assurance Plan determines QA duties, areas for review, and ___.\",\n        \"options\": [\n            \"Work products for SQA\",\n            \"Budget allocations\",\n            \"Marketing campaigns\",\n            \"End-user surveys\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Software quality describes the degree to which components meet specified requirements and ___.\",\n        \"options\": [\n            \"Developer convenience\",\n            \"User or customer needs\",\n            \"Hardware constraints\",\n            \"Last-minute changes\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which of the following best describes software engineering?\",\n        \"options\": [\n            \"Writing code without documentation\",\n            \"A systematic, disciplined, and quantifiable approach to software development\",\n            \"Installing and configuring hardware\",\n            \"Debugging programs only\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"What is the pin to the admin panel\",\n        \"options\": [\n            \"4224\",\n            \"1245\",\n            \"1337\",\n            \"8008\"\n        ],\n        \"answer\": \"B\"\n    }\n]');
INSERT INTO `question_sets` (`id`, `folder`, `questions_json`) VALUES
(14, 'comp705-02', '[\n    {\n        \"question\": \"What does Artificial Intelligence (AI) refer to?\",\n        \"options\": [\n            \"Machines that only store data\",\n            \"Simulation of human intelligence in machines\",\n            \"Hardware designing process\",\n            \"Simple rule-based scripts\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"AI enables machines to think and act like ___?\",\n        \"options\": [\n            \"Robots only\",\n            \"Humans\",\n            \"Plants\",\n            \"Animals\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which of the following tasks is NOT mentioned as an AI capability?\",\n        \"options\": [\n            \"Visual perception\",\n            \"Speech recognition\",\n            \"Language translation\",\n            \"Physical strength enhancement\"\n        ],\n        \"answer\": \"D\"\n    },\n    {\n        \"question\": \"AI involves creating algorithms and systems that perform tasks requiring human abilities such as ___?\",\n        \"options\": [\n            \"Financial forecasting only\",\n            \"Visual perception and decision-making\",\n            \"Weightlifting\",\n            \"Gardening\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"The GeeksforGeeks AI tutorial seeks a balance between ___ and capability.\",\n        \"options\": [\n            \"Efficiency\",\n            \"Complexity\",\n            \"Simplicity\",\n            \"Randomness\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"Which of these is a key objective of Artificial Intelligence (AI)?\",\n        \"options\": [\n            \"Acting solely as a hardware component\",\n            \"Enabling systems to make informed decisions\",\n            \"Serving only as a medical device\",\n            \"Providing entertainment without analysis\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"According to the article, AI systems can perform tasks requiring human-like ___?\",\n        \"options\": [\n            \"Strength\",\n            \"Speed\",\n            \"Decision-making\",\n            \"Complex emotions\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"Which of the following is a core capability of Artificial Intelligence (AI)?\",\n        \"options\": [\n            \"Data backup\",\n            \"Speech recognition\",\n            \"File compression\",\n            \"Image watermarking\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"The AI tutorial highlights tasks such as visual perception and ___?\",\n        \"options\": [\n            \"Teleportation\",\n            \"Language translation\",\n            \"Time travel\",\n            \"Levitation\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"What is AI enabling machines to do?\",\n        \"options\": [\n            \"Only follow hard-coded commands\",\n            \"Think and act like humans\",\n            \"Only operate heavy machinery\",\n            \"Only compute mathematical sums\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"According to GeeksforGeeks, AI helps machines to think and act like humans by letting them perform tasks requiring human abilities such as ___?\",\n        \"options\": [\n            \"Speech recognition and visual perception\",\n            \"Flying and swimming\",\n            \"Athletic performance\",\n            \"Telepathy\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Which of the following is a key component of AI systems as per the intro?\",\n        \"options\": [\n            \"Gardening skills\",\n            \"Visual perception\",\n            \"Dance choreography\",\n            \"Comic relief\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"The AI tutorial emphasizes developing intelligent systems that are both capable and ___?\",\n        \"options\": [\n            \"Onerous\",\n            \"Simple\",\n            \"Expensive\",\n            \"Unreliable\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which of these is NOT an example of AI tasks mentioned in the article?\",\n        \"options\": [\n            \"Decision-making\",\n            \"Language translation\",\n            \"Visual perception\",\n            \"Magic tricks\"\n        ],\n        \"answer\": \"D\"\n    },\n    {\n        \"question\": \"AI enables machines to replicate tasks that require human abilities such as ___?\",\n        \"options\": [\n            \"Land surveying\",\n            \"Quantum computing\",\n            \"Speech recognition\",\n            \"Tree climbing\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"AI involves creating algorithms that enable machines to ___.\",\n        \"options\": [\n            \"Think and act like humans\",\n            \"Only process numbers\",\n            \"Only compute geometry\",\n            \"Only store data\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Which skill area is NOT mentioned as enabled by AI in the GeeksforGeeks introduction?\",\n        \"options\": [\n            \"Visual perception\",\n            \"Speech recognition\",\n            \"Interplanetary travel\",\n            \"Language translation\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"According to the introduction, AI helps systems perform tasks requiring human abilities such as ___?\",\n        \"options\": [\n            \"Visual perception and speech recognition\",\n            \"Weightlifting\",\n            \"Swimming\",\n            \"Musical performance\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"The AI tutorial aims to strike a balance between simplicity and ___.\",\n        \"options\": [\n            \"Inaccuracy\",\n            \"Capability\",\n            \"Obscurity\",\n            \"Rigidity\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which phrase best describes AI, according to the article?\",\n        \"options\": [\n            \"Machines that mimic human intelligence\",\n            \"Machines for heavy lifting\",\n            \"Machinery for farming\",\n            \"Software for music\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"Artificial Intelligence (AI) enables systems to perform tasks requiring human-like what?\",\n        \"options\": [\n            \"Cooking skills\",\n            \"Decision-making\",\n            \"Physical strength\",\n            \"Manual labor\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"AI systems learn by identifying patterns in data and making informed what?\",\n        \"options\": [\n            \"Educated guesses\",\n            \"Choices\",\n            \"Designs\",\n            \"Predictions\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"AI improves continuously by utilizing methods like ___ and ___.\",\n        \"options\": [\n            \"Reinforcement Learning; Simulation\",\n            \"Machine Learning; Deep Learning\",\n            \"Manual Coding; Debugging\",\n            \"Statistical Analysis; Forecasting\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Machine Learning (ML) is a subset of AI that focuses on building systems that can ___ from data.\",\n        \"options\": [\n            \"Copy\",\n            \"Learn\",\n            \"Ignore\",\n            \"Store\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"In ML, a model improves its performance over time without what?\",\n        \"options\": [\n            \"Overnight rest\",\n            \"Human intervention\",\n            \"Data updates\",\n            \"System reboot\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"AI allows machines to think and act like ___ by performing human-like tasks.\",\n        \"options\": [\n            \"Robots\",\n            \"Software\",\n            \"Humans\",\n            \"Animals\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"Learning from data and making decisions are examples of AI systems becoming more ___.\",\n        \"options\": [\n            \"Autonomous\",\n            \"Complex\",\n            \"Human-like\",\n            \"Unpredictable\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"ML models identify ___ within data.\",\n        \"options\": [\n            \"Errors\",\n            \"Patterns\",\n            \"Noise\",\n            \"Redundancies\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"According to the article, AI performs tasks that typically require human ___ abilities.\",\n        \"options\": [\n            \"Emotional\",\n            \"Physical\",\n            \"Intelligent\",\n            \"Manual\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"What technological method allows AI to improve its performance over time?\",\n        \"options\": [\n            \"Hard-coding\",\n            \"Manual tuning\",\n            \"Machine Learning\",\n            \"Random guessing\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"AI systems are trained with data to construct processors that can ___ and make decisions.\",\n        \"options\": [\n            \"Think\",\n            \"Repeat\",\n            \"Ignore\",\n            \"Deter\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"AI differs from traditional programming because it enables systems to ___ from data rather than being explicitly programmed.\",\n        \"options\": [\n            \"Ignore\",\n            \"Adapt\",\n            \"Predict\",\n            \"Store\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Which of the following is a core focus of AI systems as per the article?\",\n        \"options\": [\n            \"Learning from data\",\n            \"Manual operation\",\n            \"Static logic\",\n            \"Fixed responses\"\n        ],\n        \"answer\": \"A\"\n    },\n    {\n        \"question\": \"What allows AI to act like humans according to the GeeksforGeeks article?\",\n        \"options\": [\n            \"Hardware advancements\",\n            \"Data processing\",\n            \"Predefined rules\",\n            \"Learning algorithms\"\n        ],\n        \"answer\": \"D\"\n    },\n    {\n        \"question\": \"Which term describes ML\'s ability to improve without explicit programming?\",\n        \"options\": [\n            \"Automated debugging\",\n            \"Unsupervised scripting\",\n            \"Self-improvement\",\n            \"Autonomous tuning\"\n        ],\n        \"answer\": \"C\"\n    },\n    {\n        \"question\": \"What is the broader field that includes ML as a component?\",\n        \"options\": [\n            \"Data Science\",\n            \"Artificial Intelligence\",\n            \"Computer Graphics\",\n            \"Network Engineering\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"AI systems make informed choices by learning from what?\",\n        \"options\": [\n            \"Rules\",\n            \"Data\",\n            \"User input\",\n            \"Randomness\"\n        ],\n        \"answer\": \"B\"\n    },\n    {\n        \"question\": \"Deep learning is mentioned as a method that helps AI systems to ___.\",\n        \"options\": [\n            \"Store data\",\n      